// Obtain 256-bit prime
void DH_getprime(DH *dh, int seed)
{
	int idx;
	if(!dh->p) dh->p = BN_new();

	srand(seed);
	idx = rand() & 63;
	BN_bin2bn(primetable[idx], 32, dh->p);
	BN_dec2bn(&dh->g, "5");
}

// Obtain 1024-bit prime
void DH_getbigprime(DH *dh, int seed)
{
	int idx;
	if(!dh->p) dh->p = BN_new();

	srand(seed);
	idx = rand() & 63;
	BN_bin2bn(primetable[idx], 128, dh->p);
	BN_dec2bn(&dh->g, "5");
}